import React from "react";
import $ from 'jquery';
import {Link} from 'react-router-dom';

document.addEventListener("DOMContentLoaded", function(event) {

    const showNavbar = (toggleId, navId, bodyId, headerId) =>{
    const toggle = document.getElementById(toggleId),
    nav = document.getElementById(navId),
    bodypd = document.getElementById(bodyId),
    headerpd = document.getElementById(headerId)

    if(toggle && nav && bodypd && headerpd){
    toggle.addEventListener('click', ()=>{
    nav.classList.toggle('show')
    toggle.classList.toggle('bx-x')
    bodypd.classList.toggle('body-pd')
    headerpd.classList.toggle('body-pd')
    })
    }
    }

    showNavbar('header-toggle','nav-bar','body-pd','header')

    const linkColor = document.querySelectorAll('.nav_link')

    function colorLink(){
    if(linkColor){
    linkColor.forEach(l=> l.classList.remove('active'))
    this.classList.add('active')
    }
    }
    linkColor.forEach(l=> l.addEventListener('click', colorLink))

    });

const Sidebar = () => {
    return(
   <div>
       <div className="btn"> <span className="fas fa-bars"></span> </div>
<nav className="sidebar">
    <div className="text"> BBBootstrap.com </div>
    <ul className="main_side">
        <li className="active"><Link to="#">Dashboard</Link></li>
        <li> <Link to="#" id="1">Pages <span className="fas fa-caret-down"></span> </Link>
            <ul className="item-show-1">
                <li><Link to="#">Contact us</Link></li>
                <li><Link to="#">Our Team</Link></li>
            </ul>
        </li>
        <li> <Link to="#" id="2">Services <span className="fas fa-caret-down"></span> </Link>
            <ul className="item-show-2">
                <li><Link to="#">App Design</Link></li>
                <li><Link to="#">Web Design</Link></li>
            </ul>
        </li>
        <li><Link to="#">Users</Link></li>
        <li><Link to="#">Message</Link></li>
        <li><Link to="#">Bookmark</Link></li>
        <li><Link to="#">Files</Link></li>
    </ul>
</nav>
<div className="content">
    <div className="header"> Main content goes here </div>
</div>
   </div>

    );
}

export default Sidebar;
